import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/SelectTemplate";
import ProfilesList from "./pages/CreatePortfolio";
import PortfolioPage from "./pages/ProfessionalsList";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/list" element={<ProfilesList />} />
        <Route path="/portfolio/:id" element={<PortfolioPage />} />
      </Routes>
    </Router>
  );
}

export default App;
